import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonButtons, IonButton, IonIcon, IonBackButton } from '@ionic/react';
import React from 'react';
import QRComponent from '../components/QRComponent';
import './QRPage.css';

const Home: React.FC = () => {
  return (
    <IonPage>
      <IonHeader>


      <IonToolbar>
    <IonButtons slot="secondary">
      <IonButton fill="solid">
        <IonIcon slot="start" name="person-circle" />
        Contact
      </IonButton>
    </IonButtons>
    <IonTitle>Solid Buttons</IonTitle>
    <IonButtons slot="primary">
      <IonButton fill="solid" color="secondary">
        Help
        <IonIcon slot="end" name="help-circle" />
      </IonButton>
    </IonButtons>
  </IonToolbar>


      </IonHeader>
      <IonContent>
        <QRComponent />
      </IonContent>
    </IonPage>
  );
};

export default Home;
